import React, { Fragment } from "react";
import ReactDOM from "react-dom";
import Button from './Button'
import './styles.css'
import ComponentA from "./ComponentA";
import ComponenteB from "./ComponenteB";

function soma(a, b) {
  alert(a + b);
}

const App = () => {
  return (
    <div className="App">Hello Word! <Button onClick={() => soma(10, 20)} name='Gabriel Nunes' />{/*  componentes são common case, ou seja sempre maiuscula
    // posso usar quantos componentes eu quiser */}
    <ComponentA>
      <ComponenteB>
        <Button onClick={() => soma(49, 20)} name='Gabriel Nunes' />
      </ComponenteB>
    </ComponentA>
    </div>
  )
}

const rootElement = document.getElementById('root')
ReactDOM.render(<App />, rootElement)
